(572, 'es', 'support', 'support_cont1', '<fieldset>\r\n<legend>Seo Panel Sistema de Soporte</legend>\r\n<ul class=\\"infobox\\">\r\n    <li>\r\n        <h1>1000 Directorios Paquete</h1> \r\n        <p>\r\n            Estamos proporcionando un paquete con <b>1000 directorios en internet activos y verificados</b>, para que los pueda agregar a su panel Seo y herramienta de envio a directorios.\r\n         Le ayudar a aumentar los <b> backlilnks </b> de sus sitios web.\r\n            \r\nEn realidad la lista de 1000 directorios se realizo para recoger algo de dinero para el futuro <b>\r\nDesarrollo </b> del panel seo.\r\n\r\n           Para obtener la lista de directorios 1000 por favor <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">realice una donacin de </a>\r\n$10 o ms para mejorar las caractersticas del seo panel.\r\n            Si usted tiene alguna pregunta sobre el paquete de 1000 directorios, por favor <a href=\\"<?=SP_CONTACT_LINK?>\\"\r\ntarget=\\"_blank\\">contctenos</a> o abrir un ticket en <a href=\\"<?=SP_SUPPORT_LINK?>\\"\r\ntarget=\\"_blank\\">soporte del sistema</a>.   \r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Visite este enlace para donar a seo panel</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n    \r\n    <li>\r\n        <h1>Paquete de motores de bsqueda local</h1> \r\n        <p>\r\n   \r\nAada <b> motores de bsqueda locales </b> de google, yahoo, msn (<b>por ejemplo, : www.google.de, www.google.fr Etc </b>) para que Seo Panel verifique sus palabras clave en buscadores a nivel local.\r\n\r\n\r\n           Para obtener el paquete de bsqueda en motores de busqueda locales (de acuerdo a sus necesidades), por favor <a\r\nhref=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">realice una donacin de</a> $ 10 o ms para mejorar las caractersticas de seo panel.\r\n            Antes de la donacin, por favor <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">contactenos</a> para que nos proporcione la lista de los buscadores locales.\r\n            <br><br>              \r\n            Tambin para agregar <b> nuevos motores de bsqueda (por ejemplo: baidu.com) </b> para poder comprobar sus mejoras en estos buscadores con sus palabras clave,\r\npor favor <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">contactenos</a> o abra un ticket en<a\r\nhref=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">la seccin de soporte del sistema</a>. \r\n        </p>        \r\n        <p class=\\"visit\\">\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Visita este enlace para contactar con nosotros</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n    \r\n    <li>\r\n        <h1>Seo Panel Plugins</h1> \r\n        <p>\r\n        Aada <b> plugins SEO </b> a su panel seo para <b> ampliar las caractersticas </b> de acuerdo a sus requisitos.\r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Seo panel plugins</a> son proporcionados por el panel seo\r\ny sitios de terceros.\r\n           Tambin es posible <b> desarrollar  </b> plugins SEO para su panel de seo.\r\n            Usted puede <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">presentar</a> su plugin seo seo de panel y\r\nvamos a <b>publicar</b> en nuestro sitio web despus de nuestra  <b>  proceso de revisar</b>.        \r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Visita este enlace para obtener seo panel plugins</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>Contactenos</h1> \r\n        <p>\r\n        Contacte con nosotros para cualquier pregunta sobre <b>Herramientas seo panel, plugins y caractersticas etc </b> mediante el uso de continuacin\r\nenlace.   \r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Visita este enlace para contactar con nosotros</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>Boletos de Soporte</h1> \r\n        <p>\r\n           Para obtener <b> apoyo tcnico</b> en el panel del equipo seo para configurar el panel de <b>Herramientas seo, plugins y\r\ncaractersticas </b>. Por ejemplo: Para configurar el cron para la posicin corrector de palabras clave.\r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Visita este enlace para crear un boleto de soporte</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>Informar de bugs</h1> \r\n        <p>\r\n            Informe <b>bugs</b> sobre <b>seo panel herramientas, plugins y caractersticas etc </b> mediante el uso de link de abajo.\r\n           por favor ayuda a mejorar las caractersticas en las versiones siguientes.       \r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Visita este enlace para informar de los errores</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n</ul>\r\n</fieldset>', '2011-03-12 03:36:41'),
(573, 'es', 'support', 'support_cont2', '<fieldset>\r\n<legend>Seo Panel Recursos en linea</legend>\r\n<ul class=\\"infobox\\">\r\n        \r\n    <li>\r\n        <h1>Seo Panel Gua de Ayuda</h1> \r\n        <p>\r\n            Puede ver la <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">seo panel documentacin</a> en el\r\n<b>gua de ayuda</b>, que contiene e <b>documentacin</b> para el panel de herramientas seo, plugins y afines\r\ncaractersticas.\r\n            <br>Es el mejor lugar en Internet para obtener <b> ayuda </b> acerca del panel de seo. Esperamos que\r\n<b> contribuir </b> para ayudar a la gua del panel seo, si usted encuentra errores o cosas que faltan.      \r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Visita seo panel de gua de ayuda</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>Seo Panel Foro</h1> \r\n        <p>\r\n            Un sitio para hablar sobre la primera fuente abierta del mundo <b> seo panel de control </b>.\r\n            Es el mejor lugar para encontrar las <b>respuestas </b> para su <b> preguntas </b> acerca del panel de seo. \r\n            <br>Adems, puede <b> comparte </b> el  <b>experiencia</b>, mientras que usando el panel de SEO para optimizar su\r\nsitios web.                             \r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Visita seo panel foro</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n</ul>    \r\n</fieldset>', '2011-03-12 03:36:41'),
(574, 'es', 'support', 'support_cont3', '<fieldset>\r\n<legend>Haz una donacin a Seo Panel</legend>\r\n<ul class=\\"infobox\\">        \r\n    <li>\r\n        <h1>Haz una donacin a Seo Panel - En primer Open source seo panel de control en el mundo</h1> \r\n        <p>\r\n            <b>Donar</b> seo panel para soporte de primera Open source seo panel de control en el mundo.\r\n            Estamos planeando aadir y mejorar <b>  caractersticas </b> del SEO panel en el futuro.\r\n            <br>Con todos sus <b> apoyo </b> nico que podemos alcanzar nuestros <b>objetivos  </b>.\r\n            Si usted siente que es el panel seo <b> vale la pena </b> para usted, por favor, donar alguna cantidad a la seo equipo de panel.\r\n            <br>Nos <b> publicar </b> su nombre y sitio de informacin en <a href=\\"<?=SP_DONATE_LINK?>\\"\r\ntarget=\\"_blank\\">donation page</a>, una vez que tengamos una donacin.\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Visita este enlace para donar a seo panel</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n</ul>\r\n</fieldset>', '2011-03-12 03:36:41'),
