(3146, 'pt', 'home', 'home_cont1', '<h1 style=\\"text-align: center;margin-bottom: 30px;font-size: 19px;\\">Bem-vindo ao Seo Painel - ao primeiro painel de controle seo para vrios sites do mundo</h1>\r\n<p>\r\nUm completo <b>  Seo Panel de controle, software livre </b> para gerenciar <b> a optimizao do motor de busca </b> dos seus sites.\r\nSeo Panel  um <b> kit de ferramentas </b> que inclui as mais recentes ferramentas de SEO para <b> aumentar e controlar </b>\r\n<b> performace </B> dos seus sites.\r\n um software livre <b> </b> lanado em <b>  GNU LICENA PBLICA GERAL </b>.\r\nA principal caracterstica do painel de seo  a sua extensibilidade <b> </b> usando <a href = \\"<?=SP_PLUGINSITE?>\\" target = \\"_blank\\"> seo plugins </a>.\r\nQualquer um pode facilmente <b> desenvolver e instalar </b>  plugins necessrios para seu painel de seo.\r\n</P>\r\n</p>\r\n<p>\r\nEste software de cdigo aberto foi <b> lanado em janeiro de 2010 </b>.\r\nCom <b> neste curto perodo </b> de tempo milhares de <b> webmasters </b> esto usando este software para optimizao dos seus sites.\r\nUtilize o painel de SEO hoje  <b>e desfrute </b> tudo relacionado ao seo sob uma nica <b> plataforma </b>.\r\n</P> ', '2011-07-10 02:41:24'),
(3147, 'pt', 'home', 'home_cont2', '<fieldset>\r\n<legend> Principais Caractersticas do Seo Panel <?=SP_INSTALLED?> </legend>\r\n<ul class=\\"infobox\\">\r\n<li>\r\n<h1>Ferramenta de Envio automtico Diretrio </h1>\r\n<p>\r\nFerramenta automtica da submisso do directrio para nos ajudar<b> a apresentar os nossos sites </b> nos maiores <b> , grandes\r\ne pagos directrios da Internet </b>.\r\nNs tambm podemos <b> acompanhar o status </b> de cada submisso atravs <b> de uma verificao peridica </b> usando o \r\nstatus <b> submisso de script </b>.\r\n<b> gerenciando o Directrio </b> ir nos ajudar a descobrir se est ativo diretrio <b> </b> ou no.\r\n</P>\r\n</Li>\r\n<li>\r\n<h1> Posio Palavra Checker </h1>\r\n<p>\r\nPalavra verificador posio encontra-se o <b> posio do motor de pesquisa </b> de <b> palavras-chave especficas </b>\r\ndo seu site e lojas <b> </b>-lo no sistema.\r\nNa seo de palavra-chave relatrios de posio, podemos ver o <b> posies dirias </b> de palavras-chave\r\ndiferentes motores de busca, <b> belos grficos </b> e <b> relatrios detalhados </b>.\r\n</P>\r\n</Li>\r\n<li>\r\n<h1> Sitemap Generator </h1>\r\n<p> Isso ajudar a criar <b> XML, HTML, TEXTO </b> arquivos sitemap do nosso site para apresentar aos motores de busca. </p>\r\n</Li>\r\n<li>\r\n<h1> Google e Alexa Rank Checker </h1>\r\n<p>\r\nGoogle e verificador alexa rank vai encontrar <b> google pagerank </b>e <b> alexa rank </b> da nossos<b> sites e lojas </b> no sistema.\r\nEm <b> relatrios Rank </b>, podemos ver o <b> rank dirio da </b> Google e Alexa rank de cada website por <b> relatrios detalhados </b>.\r\n</P>\r\n</Li>\r\n<li>\r\n<h1> Backlinks Checker </h1>\r\n<p>\r\nverificador Backlinks encontrar <b> nmero de backlinks </b> dos nossos sites em busca diferentes\r\nmotores <b>(Yahoo, google, msn, etc) </b> e lojas <b> </b>-lo no sistema.\r\n<br> Em <b> relatrios backlink </b>, podemos ver os backlinks <b> contagem diria </b> de cada\r\nsite por <b> relatrios detalhados </b>.\r\n</P>\r\n</Li>\r\n<li>\r\n<h1> Saturao Search Engine Checker </h1>\r\n<p>\r\nSearch Engine verificador Saturao encontrar <b> nmero de pginas indexadas </b> dos nossos sites em diferentes<b> motores de busca (google, yahoo, MSN etc) </b> e lojas <b> </b>-lo no sistema.\r\nEm <b> motor de busca de saturao verificador relatrios </b>, podemos ver a pgina <b> dirios indexados\r\nContagem </b> de cada site por <b> relatrios detalhados </b>.\r\n</P>\r\n</Li>\r\n<li>\r\n<h1>Seo plugins </h1>\r\n<p>\r\nA caracterstica principal <b> </b> do painel de controle  o seu seo extentability <b> </b>.\r\nAdicionar seo <b> plugins </b> ao seu painel de seo para <b> estender os recursos </b> De acordo com o seu\r\nexigncia.\r\n<A href = \\"<?=SP_PLUGINSITE?>\\" Target = \\"_blank\\"> Painel Seo plugins </a> so fornecidos por ambas painel seo\r\ne terceiro locais do partido.\r\nVoc tambm pode facilmente desenvolver <b> </b> plugins de SEO para seu painel de seo.\r\nVoc pode <a href = \\"<?=SP_PLUGINSITE?>\\" Target = \\"_blank\\"> apresentar </a> o seu plugin para seo seo painel e\r\nvamos publicar <b> </B> em nosso site depois da nossa <reviso <b> processo </b>.\r\n</P>\r\n</Li>\r\n<li>\r\n<h1> Meta Tag Generator </h1>\r\n<p>\r\nMeta tag  um gerador de painel seo <b> plugin </b> para criar <b> personalizado meta tags </b> para o nosso\r\nsite.\r\nIsso nos ajudar a dar mais informaes <b> </b> sobre o nosso site para <b> motor de busca robs </b>\r\nenquanto que rastejam nosso site.\r\n</P>\r\n</Li>\r\n</Ul>\r\n</Fieldset> ', '2011-07-10 02:41:24'),
(3148, 'pt', 'home', 'home_cont3', '<fieldset>\r\n<legend> Recursos on-line do Seo Panel </legend>\r\n<ul class=\\"infobox\\">\r\n\r\n<li>\r\n<h1> Recursos Online de Referncia do SEO Panel  </h1>\r\n\r\n\r\n<p>\r\n<a href=\\"http://www.seopanel.in\\" target=\\"_blank\\"> Site Oficial do Seo Panel </a>\r\n</P>\r\n<p>\r\n<A href = \\"<?=SP_DOWNLOAD_LINK?>\\" Target = \\"_blank\\"> Download Seo Panel </a>\r\n</P>\r\n\r\n<p>\r\n<A href = \\"<?=SP_DEMO_LINK?>\\" Target = \\"_blank\\"> Seo Panel Demo </a>\r\n</P>\r\n\r\n<p>\r\n<A href = \\"<?=SP_CONTACT_LINK?>\\" Target = \\"_blank\\"> contactar Seo Panel </a>\r\n</P>\r\n\r\n<p>\r\n<A href = \\"<?=SP_HELP_LINK?>\\" Target = \\"_blank\\"> Guia de Ajuda do Seo Panel  </a>\r\n</P>\r\n\r\n<p>\r\n<A href = \\"<?=SP_FORUM_LINK?>\\" Target = \\"_blank\\"> Frum do Seo Panel </a></P>\r\n\r\n<p>\r\n<A href = \\"<?=SP_SUPPORT_LINK?>\\" Target = \\"_blank\\"> Seo panel sistema de suporte </a>\r\n</P>\r\n\r\n<p>\r\n<A href = \\"<?=SP_DONATE_LINK?>\\" Target = \\"_blank\\"> Doar para Seo Panel </a>\r\n</P>\r\n</Li>\r\n\r\n</Ul>\r\n</Fieldset> ', '2011-07-10 02:41:24'),
