(3213, 'ro', 'support', 'support_cont3', '<fieldset> \r\n<legend>Donati panoului Seo</legend> \r\n<ul class=\\"infobox\\">         \r\n    <li> \r\n        <h1>Donati panoului seo - Primul Open Source panou de control Seo din lume</h1>  \r\n        <p> \r\n            <b>Donati</b> panoului Seo pentru sustinerea primului panou seo din lume. \r\n            Planuim sa  <b>adaugam si imbunatatim</b> caracteristici ale panoului seo pe viitor.  \r\n            <br>Cu ajutorul <b>suportului</b> dvs. ne putem atinge  <b>telul</b>. \r\n            Daca crezi ca panoul de control seo  <b>conteaza</b> pentru tine, va rugam donati cat vreti echipei Seo Panel. \r\n            <br>Va vom <b>publica</b> numele si informatii despre site-ul dvs in <a href=\\"<?=SP_DONATE_LINK?>\\"\r\ntarget=\\"_blank\\">pagina de donatii</a>, de indata ce primim donatia. \r\n        </p> \r\n        <p> \r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Vizitati acest link pentru a dona Panoului Seo</a> \r\n        </p> \r\n        <br> \r\n    </li> \r\n</ul> \r\n</fieldset>', '2010-11-05 12:42:48'),
(3214, 'ro', 'settings', 'Click here to become a sponsor for Seo Panel', '<b>Donati $100</b> si deveniti <b>sponsor</b> al Seo Panel.', '2011-07-07 02:04:01'),
(3215, 'ro', 'settings', 'seopanel_description', 'Un panou de control complet gratis pentru a controla optimizarea site-urilor dvs. Contine o ultime de unelte noi pentru a creste si verifica performantele site-ului dvs. Este un software open source si deasemenea va puteti dezvolta singuri plugin-urile pentru panoul seo al dvs.', '2011-07-07 02:04:01'),
