(3302, 'hu', 'support', 'support_cont1', '<fieldset>\r\n<legend>Seo Panel Tmogati Rendszer</legend>\r\n<ul class=\\"infobox\\">\r\n    <li>\r\n        <h1>1000 darabos katalguscsomag</h1> \r\n        <p>\r\n           Biztostunk egy <b>1000 darabos ingyenes</b> katalguscsomagot, melyekbe automatikusan tudja weboldalait bekldeni a <b>linkbekld eszkzzel</b>.\r\n            Ezzel knnyedn nvelheti oldalainak backlink szmt <b>oldalainak backlink szmt</b>.\r\n            A katalgusok megszerzshez krlek <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">tmogasd</a> minimum\r\n$10-al a Seo Panel fejlesztst.\r\n            Ha krdsed van a csomaggal kapcsolatban krlek lpj <a href=\\"<?=SP_CONTACT_LINK?>\\"\r\ntarget=\\"_blank\\">kapcsolatba velnk</a>, vagy krjen egy jegyet az <a href=\\"<?=SP_SUPPORT_LINK?>\\"\r\ntarget=\\"_blank\\">gyflszolglattl</a>.   \r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">A Seo panel tmogatshoz ltogassa meg ezt a linket.</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n    \r\n    <li>\r\n        <h1>Helyi keresmotor csomag</h1> \r\n        <p>\r\n            Adjon <b>helyi keresst</b> a google-hoz,yahoo-hoz,msn-hez(pldul: <b>www.google.de,www.google.fr,www.google.hu\r\nstb..</b>). gy a <b>kulcsszhelyezs vizsglval</b> a lokalizlt eredmnyeket tudja megtekinteni. \r\n            A helyi kerescsomag megszerzshez <a\r\nhref=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">tmogatnia</a> kell minimum $10-al a Seo Panelt.\r\n            Mieltt elklden a tmogatst, krem lpjen <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">velnk kapcsolatba</a>, s kldje el neknk az n ltal kvnt keresmotor domain kiterjesztst(pl.: .hu, .fr stb..).\r\n            <br><br>              \r\n           j <b>keresmotor</b>(pl.:baidu.com) hozzadshoz,\r\nkrem lpjen <a href=\\"<?=SP_CONTACT_LINK?>\\"\r\ntarget=\\"_blank\\">kapcsolatba velnk</a>, vagy krjen egy jegyet az <a href=\\"<?=SP_SUPPORT_LINK?>\\"\r\ntarget=\\"_blank\\">gyflszolglattl</a>.  \r\n        </p>        \r\n        <p class=\\"visit\\">\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Ltogassa meg ezt a linket, hogy kapcsolatba lphessen velnk.</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n    \r\n    <li>\r\n        <h1>Seo Panel Kiegsztk</h1> \r\n        <p>\r\n            Adjon hozz klnbz <b>kiegsztket</b> Seo paneljhez, hogy <b>bvthesse a funkciit</b>.\r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Seo panel kiegsztket</a> a Seo panel hivatalos oldala mellett egyb oldalakon is tallhat.\r\n             Knnyedn <b>fejleszthet</b> n is Seo Kiegsztket a Seo Panelhez.\r\n            Az n ltal fejlesztett kiegsztket <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">bekldheti</a> a Seo Panel oldalra ahol egy rvid ttekints utn <b>megjelenik</b> a tbbi kiegszt kztt.       \r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Kiegsztk letltshez ltogassa meg ezt az oldalt.</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>Kapcsolat</h1> \r\n        <p>\r\n            Ha brmilyen krdse van(<b>kiegsztk, fejleszts, stb..</b>), akkor az albbi linken lpjen velnk kapcsolatba.        \r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Ltogassa meg ezt az oldalt a kapcsolatfelvtelhez.</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>gyflszolglati jegy</h1> \r\n        <p>\r\n          A Seo panel csapat <b>Technikai tmogatsrt</b>(kiegsztk teleptse, cron belltsa) lpjen kapcsolatba az gyflszolglattal.\r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Ltogassa meg ezt a linket, hogy kapcsolatba lphessen az gyflszolglattal.</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>Hibk bejelentse</h1> \r\n        <p>\r\n            <b>Hibk</b> bejelentshez hasznlja az albbi linket. Ezzel nagymrtkben hozzjrul a program fejlesztshez. \r\n                     \r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Hibabejelentshez krem ltogassa meg az albbi oldalt.</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n</ul>\r\n</fieldset>', '2010-11-05 19:21:42'),
(3303, 'hu', 'support', 'support_cont2', '<fieldset>\r\n<legend>Seo Panel Online Forrsok</legend>\r\n<ul class=\\"infobox\\">\r\n        \r\n    <li>\r\n        <h1>Seo Panel tmutat</h1> \r\n        <p>\r\n            A <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Seo panel-hez tartoz dokumentcit</a> az\r\n<b>tmutatban</b> tallja, amely tartalmaz minden olyan informcit amely segt a Seo panel hasznlatban.\r\n            <br>Ez a legjobb hely az interneten, hogy <b>segtsget kapj</b> a Seo panellel kapcsolatban. Remljk, hogy az esetleges elrsokat, hinyossgokat segt neknk ptolni.               \r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Seo Panel tmutat megtekintse.</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>Seo Panel Frum</h1> \r\n        <p>\r\n            Ez az a hely ahol szabadon megoszthatja <b>tapasztalatait</b> a <b>Seo panel</b>-el kapcsolatban. \r\n            Vlaszokat tallhat a megoldhatatlannak tn <b>krdseire</b>, tovbb <b>tapasztalatait</b> is megoszthatja msokkal. \r\n                             \r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Seo panel frumnak megtekintse</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n</ul>    \r\n</fieldset>', '2010-11-05 19:21:42'),
(3304, 'hu', 'support', 'support_cont3', '<fieldset>\r\n<legend>Seo panel tmogatsa</legend>\r\n<ul class=\\"infobox\\">        \r\n    <li>\r\n        <h1>Tmogassa a Seo panelt - amely a vilg els nylt forrskd Seo segdje.</h1> \r\n        <p>\r\n            <b>Tmogassa</b> a Seo panelt - amely a vilg els nylt forrskd Seo segdje.\r\n            Tervezzk, hogy a jvben folyamatosan j <b>funkcikat</b> adunk a Seo panelhez, de ehhez az n segtsgre is szksg van.\r\n           \r\n            Ha gy rzed, hogy a Seo panel <b>hasznos</b> szmodra, akkor krlek tmogasd a fejlesztk csapatt.\r\n            Miutn tmogattl minket, nevedet s oldalad linkjt <br><b>kzz</b> tesszk a <a href=\\"<?=SP_DONATE_LINK?>\\"\r\ntarget=\\"_blank\\">tmogati oldalon</a>.\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">A seo panel tmogatshoz ltogassa meg ezt az oldalt.</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n</ul>\r\n</fieldset>', '2010-11-05 19:21:42'),
