(4679, 'cs', 'support', 'support_cont2', '<fieldset> \r\n<legend>Online zdroje SEO panelu</legend> \r\n<ul class=\\"infobox\\"> \r\n         \r\n    <li> \r\n        <h1>Npovda SEO panelu</h1>  \r\n        <p> \r\n            Mete se podvat do <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">dokumentace SEO panelu</a> v\r\n<b>npovd</b>, kter obsahuje <b>dokumentaci</b> k SEO panelu, nstrojm, pluginm a k pslunm vlastnostem. \r\n            <br>Je to to nejlep msto na internetu, kde <b>zskte npovdu</b> o SEO panelu. Doufme, e <b>pispjete</b> do npovdy SEO panelu v ppad, e objevte chyby nebo chybjc vci.   \r\n        </p> \r\n        <p> \r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Podvejte se do npovdy SEO panelu</a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n    <li> \r\n        <h1>Forum SEO panelu</h1>  \r\n        <p> \r\n           Msto k diskuzi o prvnm otevenm <b>ovldacm panelu pro SEO</b> na svte.\r\nJe to nejlep msto, kde najt <b>odpovdi</b> na vae <b>otzky</b> o SEO panelu.\r\n            <br>Mete tak <b>sdlet</b> vae <b>zkuenosti</b> z toho, jak pomoc SEO panelu optimalizujete vae strnky.                                \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Navtivte forum SEO panelu</a> \r\n        </p> \r\n        <br> \r\n    </li> \r\n</ul>     \r\n</fieldset>', '2011-03-23 01:41:17'),
(4680, 'cs', 'support', 'support_cont3', '<fieldset> \r\n<legend>Podpote finann SEO Panel</legend> \r\n<ul class=\\"infobox\\">         \r\n    <li> \r\n        <h1>Podpote finann SEO Panel - prvn open source ovldac panel pro SEO na svt</h1>  \r\n        <p> \r\n            <b>Podpote finann</b> Seo Panel - prvn open source ovldac panel pro SEO na svt \r\n            Chceme v budoucnu <b>pidvat a vylepovat</b> funkce SEO panelu.  \r\n            <br>Pouze s va <b>podporou</b> meme doshnout naich <b>cl</b>. \r\n            Pokud mte pocit, e SEO Panel je pro vs <b>pnosem</b>, prosme podpote finann uritou stkou tm SEO Panelu. \r\n            <br>Jakmile obdrme vai finann podporu, <b>zveejnme</b> vae jmno a informace o vaich strnkch na <a href=\\"<?=SP_DONATE_LINK?>\\"\r\ntarget=\\"_blank\\">strnce s dary</a>. \r\n        </p> \r\n        <p> \r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Navtivte tento odkaz, abyste mohli finann podpoit SEO Panel.</a> \r\n        </p> \r\n        <br> \r\n    </li> \r\n</ul> \r\n</fieldset>', '2011-03-23 01:41:17'),
